import { generate } from "@pdfme/generator";
import {useEffect} from "react";
export default function Pdf() {
    useEffect(() => {
      const queryString = window.location.search;
      const urlParams = new URLSearchParams(queryString);
      (async () => {
        const font = {
            serif: {
              data: await fetch('/Charm-Regular.ttf').then((res) => res.arrayBuffer()),
              fallback:true,
            },
            Roboto:{
              data: await fetch('/Roboto-Medium.ttf').then((res) => res.arrayBuffer()), 
            }
          }
        const template = {
          "schemas": [
            {
              "field2": {
                "type": "text",
                "position": {
                  "x": 53.89,
                  "y": 91.39
                },
                "width": 189.16,
                "height": 25.84,
                "fontSize": 36,
                "fontColor": "#000",
                "fontName": "serif",
                "alignment": "center",
                "verticalAlignment": "bottom"
              },
              "field1": {
                "type": "text",
                "alignment": "center",
                "position": {
                  "x": 101.97,
                  "y": 120
                },
                "width": 62.43,
                "height": 6.12,
                "fontSize": 12,
                "fontName": "Roboto"
              },
              "field3": {
                "type": "text",
                "alignment": "center",
                "position": {
                  "x": 166.12,
                  "y": 120
                },
                "width": 33.58,
                "height": 6.12,
                "fontSize": 12,
                "fontName": "Roboto"
              }
            }
          ],
        "basePdf": "data:application/pdf;base64,"
};
        const inputs = [
        {
          "field2": urlParams.get("name"),
          "field1": urlParams.get("InstName"),
          "field3": urlParams.get("location")
        }
      ];
          
            const pdf = await generate({ template, inputs,options:{font} });
            console.log(inputs)
          
            // Node.js
            // fs.writeFileSync(path.join(__dirname, 'test.pdf'), pdf);
          
            // Browser
            const blob = new Blob([pdf.buffer], { type: 'application/pdf' });
            var link = document.createElement('a');
            link.href = URL.createObjectURL(blob);
            link.download = 'Vimukthi_Goal_Certificate.pdf';
            link.dispatchEvent(new MouseEvent('click'));
            window.close();
            
          })();
    })
    return (
        <div className="pdf">
            <h1>Your requested PDF file is loading...</h1>
        </div>
    );
}

